    <title>Digitized portrait of Hawk, a masculine African-American with platinum-blonde hair and golden makeup</title>
    <desc id="description">Digitized portrait of a masculine african-american with platinum-blonde hair, golden makeup, and a relaxed expression. Hundreds of gradients and polygons form the contours of their right hand, wrist, and face. They grip a white flower with two fingers; the central focus of the piece. White petals are used to enhance the radiant makeup, crafted by Leigh Fleming (MUA). Over 24 hours, the background changes colors in accordance to the sky, showcasing the hundreds of dazzling pigments that make up dark skin.
    </desc>
